import React from "react";
import Roulette from "./roulette/roulette";
import styled from "styled-components";
import Wheel from "./roulette/wheel";

const GameContainer = () => {
    let Container = styled.div `
        margin-top: 200px;
    `
    return (
        <div>
            <Container>
            <Roulette />
            <Wheel />
            </Container>
        </div>
    )
}

export default GameContainer;
